import React from 'react';

const AccountTab = ({ profile }) => (
  <div>
    <h2 className="text-2xl font-semibold mb-4">Account Details</h2>
    <p><strong>Subscription Tier:</strong> {profile?.subscriptionTier || 'Not available'}</p>
    <p><strong>Subscription Active:</strong> {profile?.subscriptionActive ? 'Yes' : 'No'}</p>
  </div>
);

export default AccountTab;
